import React, { useState, useEffect } from 'react';
import '../styles/crossycare.css';
import p1 from '../assets/crossycare.png';
import ReactDOM from 'react-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'





const CrossyCare = () => {
    const [index, setIndex] = useState(0);
    const [score, setScore] = useState(0);
    const [currentAnswer, setCurrentAnswer] = useState("");
    const [condition, setCondition] = useState("Alzeihmers");


    const A1 = { question: "What is Alzheimer's?", image: "data:image/jpeg;base64,", answer: "a neurological disease", option1: " A Psychological disease", option2: "A viral disease", option3: "A colon infection" };
    const A2 = { question: "Who is affected by Alzheimer's?", image: "data:image/jpeg;base64,", explanation: "Anyone can be affected by Alzheimer's, but it is more common in the elderly.", answer: "Anyone, but mostly elderly", option1: "Children", option2: "Young adults", option3: "Middle-aged people" };
    const A3 = { question: "Where is Alzheimer's prevalent?", image: "data:image/jpeg;base64,", explanation: "Alzheimer's is prevalent worldwide.", answer: "Worldwide", option1: "Only in urban areas", option2: "Only in rural areas", option3: "In some specific countries" };
    const A4 = { question: "Once a person reaches 65 years of age, his/her risk for Alzheimerâ€™s disease doubles every _____ years.", image: "data:image/jpeg;base64,", explanation: "5 years", answer: "5", option1: "3", option2: "10", option3: "8" };
    const A5 = { question: "Which central neurotransmitters are affected by Alzheimerâ€™s disease?", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSaDYVAQjyDFex_GVtMkXdXIXZ3ThqhJQLEVw&s", explanation: "Acetylcholine, norepinephrine, and glutamate levels are disrupted in Alzheimer's, affecting cognition and memory.", answer: "All of the above", option1: "Acetylcholine", option2: "Norepinephrine", option3: "Glutamate" };
    const A6 = { question: "Which of the following are risk factors for Alzheimerâ€™s disease?", image: "data:image/png;base64,", explanation: "Increasing age and previous head injuries are significant risk factors for developing Alzheimer's disease.", answer: "Age and head trauma", option1: "Hypertension and high triglycerides", option2: "Family history and history of tobacco use", option3: "Diabetes and history of ethanol use" };
    const A7 = { question: "Which of the following is true regarding mild cognitive impairment (MCI)?", image: "data:image/jpeg;base64,", explanation: "MCI involves noticeable but not disabling memory and thinking problems, which can sometimes progress to dementia.", answer: "A patient who is affected by mild cognitive impairment has more cognitive impairment thatwould be expected for their age, but it is not severe enough to be considered dementia.", option1: "Seventy-five percent of Americans over age 60 are affected by mild cognitive impairment.", option2: "Mild cognitive impairment always progresses to Alzheimerâ€™s disease.", option3: "Mild cognitive impairment should be treated with cholinesterase inhibitors." };
    const A8 = { question: "Which of the following conditions can affect a patientâ€™s cognitive function and produce dementia-like symptoms?", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6Yf_Cimi_yH9fvVczumNH9_5l8fKoPPNURg&s", explanation: "Conditions like infections, stroke, and metabolic disorders can mimic dementia symptoms.", answer: "All of the above", option1: "Infections", option2: "Stroke", option3: "Metabolic disorders" };
    const A9 = { question: "Which of the following medications will improve cognitive function in a patient with Alzheimerâ€™s disease?", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTs_J9ZNGbUuTFrGCGukDaF90978GUR9tbi2g&s", explanation: "Memantine: This medication helps manage symptoms by regulating glutamate activity in the brain.", answer: "Memantine", option1: "Valproate ", option2: "Benadryl", option3: "Duloxetine" };
    const A10 = { question: "Which of the following medications are currently approved for the treatment of Alzheimerâ€™s disease?", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQByyn26CDeGsIEfSg2N5FNJQUP8p6-COAmdg&s", explanation: "Razadyne: Approved cholinesterase inhibitor that helps improve cognition in Alzheimer's patients.", answer: "Razadyne", option1: "Gingko biloba", option2: "Atorvastatin (HMG CoA reductase inhibitor)", option3: "Buspar" };
    const A11 = { question: "Which of the following medications are specifically approved for the treatment of moderate to severe forms of Alzheimerâ€™s disease?", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRbjJoIMh79x0tPGY79Uz5tElFCDxsJPrKFJQ&s", explanation: "AriceptÂ® and NamendaÂ®: These drugs are used to treat moderate to severe Alzheimer's disease, improving symptoms temporarily.", answer: "AriceptÂ® and NamendaÂ®", option1: "Tacrine and galantamine", option2: "Memantine and rivastigmine", option3: "ExelonÂ® and Aricept" };
    const A12 = { question: "What is the main goal of therapy for a patient being treated for Alzheimerâ€™s disease?", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTTUuOdp-EJGvuu3eicKVWUOs-kumOW7bPrFg&s", explanation: "Maintain the patientâ€™s independence: The primary goal is to preserve the patient's quality of life and functional abilities for as long as possible.", answer: "Maintain the patientâ€™s independence", option1: "Treat the patientâ€™s symptoms", option2: "Reverse the patientâ€™s cognitive decline", option3: "Effectively treat psychiatric and behavioral complications" };
    
    const AlzeihmerQuestions = [A1, A2, A3,A4,A5,A6,A7,A8,A9,A10,A11,A12];

    const S1 = { question: "What is Sickle Cell?", image: <FontAwesomeIcon icon="fa-solid fa-globe" />, explanation: "Sickle Cell is a blood cell deformity.", answer: "A blood cell deformity", option1: "A skin condition", option2: "A neurological disorder", option3: "A digestive issue" };
    const S2 = { question: "Who can have Sickle Cell?", image: "https://example.com/image5.jpg", explanation: "Sickle Cell primarily affects people of African descent.", answer: "People of African descent", option1: "People of European descent", option2: "Only children", option3: "Only elderly" };
    const S3 = { question: "Where is Sickle Cell commonly found?", image: "https://example.com/image6.jpg", explanation: "Sickle Cell is common in regions where malaria is prevalent.", answer: "Regions where malaria is prevalent", option1: "Cold climates", option2: "Urban areas", option3: "Rural areas" };
    const SickleCellQuestions = [S1, S2, S3];

    const AD1 = { question: "What is ADHD?", image:<FontAwesomeIcon icon="fa-solid fa-globe" />, explanation: "ADHD is a neurological disorder affecting focus and behavior.", answer: "A neurological disorder", option1: "A skin condition", option2: "A physical disability", option3: "A heart condition" };
    const AD2 = { question: "Who is diagnosed with ADHD?", image: "https://example.com/image8.jpg", explanation: "ADHD is commonly diagnosed in children.", answer: "Children", option1: "Elderly people", option2: "Only men", option3: "Only women" };
    const AD3 = { question: "Where is ADHD most recognized?", image: "https://example.com/image9.jpg", explanation: "ADHD is widely recognized and treated globally.", answer: "Globally", option1: "Only in the USA", option2: "Only in Europe", option3: "Only in developing countries" };
    const ADHDQuestions = [AD1, AD2, AD3];

    const addQuestion = (condition) => {
        if (index >= 0 && index < 9) {
            let selectedQuestion;

            // Choose a question set based on the condition
            if (condition === 'Alzeihmers') {
                selectedQuestion = AlzeihmerQuestions[Math.floor(Math.random() * AlzeihmerQuestions.length)];
            } else if (condition === 'SickleCell') {
                selectedQuestion = SickleCellQuestions[Math.floor(Math.random() * SickleCellQuestions.length)];
            } else if (condition === 'ADHD') {
                selectedQuestion = ADHDQuestions[Math.floor(Math.random() * ADHDQuestions.length)];
            }

            // Clear previous content
            document.getElementById('acquestion').innerHTML = '';
            document.getElementById('imgcontainer').innerHTML = '';
            document.getElementById('the_explanation').innerHTML = '';
            document.getElementById('tile1').innerHTML = '';
            document.getElementById('tile2').innerHTML = '';
            document.getElementById('tile3').innerHTML = '';
            document.getElementById('tile4').innerHTML = '';

            // Set the question text
            document.getElementById('acquestion').innerHTML = selectedQuestion.question;

            // Set the image (if any)
            if (selectedQuestion.image) {
                const imgTag = document.createElement('img');
                imgTag.src = selectedQuestion.image;
                imgTag.style.width = '250px';
                imgTag.style.height = '250px';

                document.getElementById('imgcontainer').appendChild(imgTag);
            }

            // Set the explanation
            document.getElementById('the_explanation').innerHTML = selectedQuestion.explanation;
            document.getElementById('the_explanation').style.display = 'none';

            // Randomly assign answer and options to tiles
            const options = [selectedQuestion.answer, selectedQuestion.option1, selectedQuestion.option2, selectedQuestion.option3];
            const shuffledOptions = options.sort(() => Math.random() - 0.5);
            document.getElementById('tile1').innerHTML = shuffledOptions[0];
            document.getElementById('tile2').innerHTML = shuffledOptions[1];
            document.getElementById('tile3').innerHTML = shuffledOptions[2];
            document.getElementById('tile4').innerHTML = shuffledOptions[3];

            // Set current answer
            setCurrentAnswer(selectedQuestion.answer);

            // Hide the next button and verdict
            document.getElementById('next').style.display = 'none';
            document.getElementById('verdict').style.display = 'none';
        } else {
            // End of game
            document.getElementById('Questioncard').style.display = 'none';
            document.getElementById('results').style.display = 'block';

            if (score < 5) {
                document.getElementById('fail').style.display = 'block';
            } else if (score >= 5 && score < 10) {
                document.getElementById('pass').style.display = 'block';
            } else {
                document.getElementById('perfect').style.display = 'block';
            }
        }
    }

    const startgame = () => {
        document.getElementById("welcome").style.display = 'none';
        document.getElementById("button").classList.add('hidden');

        document.getElementById("Questioncard").style.display = 'block';
        addQuestion(condition);
    }

    const checkAnswer = (selectedOption) => {
        // Check if the selected answer is correct
        if (selectedOption === currentAnswer) {
            document.getElementById('verdict').innerHTML = 'CORRECT';
            document.getElementById('verdict').style.backgroundColor = 'green';
            setScore(score + 1);
        } else {
            document.getElementById('verdict').innerHTML = 'WRONG';
            document.getElementById('verdict').style.backgroundColor = 'red';
        }

        document.getElementById('verdict').style.display = 'block';
        document.getElementById('the_explanation').style.display = 'block';

        // Show the next button
        document.getElementById('next').style.display = 'block';

        // Increase index
        setIndex(index + 1);
    }

    const startOver = () => {
        setIndex(0);
        setScore(0);
        document.getElementById('Questioncard').style.display = 'none';
        document.getElementById('results').style.display = 'none';
        document.getElementById('welcome').style.display = 'block';
        document.getElementById('button').classList.remove('hidden');
        document.getElementById('fail').style.display = 'none';
        document.getElementById('pass').style.display = 'none';
        document.getElementById('perfect').style.display = 'none';
    }

    useEffect(() => {
        // Event listeners for tiles
        const tiles = ['tile1', 'tile2', 'tile3', 'tile4'];
        tiles.forEach(tileId => {
            document.getElementById(tileId).addEventListener('click', (e) => {
                checkAnswer(e.target.innerHTML);
            });
        });

        // Event listener for the next button
        document.getElementById('next').addEventListener('click', () => {
            addQuestion(condition);
        });

        // Event listener for the start over button
        document.getElementById('startover').addEventListener('click', startOver);
        document.getElementById('results-startover').addEventListener('click', startOver);
    }, [index, score, currentAnswer, condition]);

    return (
        <section className='fullpage'>
            <div className='title'>CrossyCare</div>
            <div id='welcome'>
                <img id='ogpic' src={p1}/>
                <p>Welcome to CrossyCare, a fun game made for patients and their families to learn more about the patient's condition.</p>
                <p>Press "START" to continue.</p>
            </div>
            <div id='button' onClick={startgame}>START</div>
            
            <div id='Questioncard'>
            <div id='where'>Question {index+1} of 10</div>
                <div id='acquestion'></div>
                <div id='imgcontainer'></div>
                <div id='verdict'></div>
                <div id='the_explanation'></div>
                <div className='controls'>
                    <div id='startover'>START OVER</div>
                    <div id='next'>NEXT</div>
                </div>
                <div className='tiles'>
                    <div className='top'>
                        <div id='tile1'></div> 
                        <div id='tile2'></div>
                    </div>
                    <div className='bottom'>
                        <div id='tile3'></div>
                        <div id='tile4'></div>
                    </div>
                </div>
                </div>
            <div id='results'>
                    <div>Your Results:</div>
                    <div id='pass'>You Passed!</div>
                    <div id='fail'>Aw, Better Luck Next Time.</div>
                    <div id='perfect'>Awesome!You got a Perfect Score!</div>
                    <div id='thescore'>Your score was {score} out of 10</div>
                    <img id='ogpic' src={p1}/>
                    <div id='results-startover'>START OVER</div>
                    
            </div>
        </section>
    );
}

export default CrossyCare;
